import styled from "styled-components";
import "./App.css";

const MapStyled = styled.div`
  div.gmap_canvas {
    overflow: hidden;
    background: none !important;
    height: 341px;
    width: 906px;
  }
  div.mapouter {
    position: relative;
    text-align: right;
    height: 341px;
    width: 906px;
  }
`;

function App() {
  return (
    <div className="App">
      <MapStyled class="mapouter">
        <div class="gmap_canvas">
          <iframe
            width="906"
            height="341"
            id="gmap_canvas"
            src="https://maps.google.com/maps?q=2880%20Broadway,%20New%20York&t=&z=13&ie=UTF8&iwloc=&output=embed"
            frameborder="0"
            scrolling="no"
            marginheight="0"
            marginwidth="0"
          ></iframe>
          <a href="https://fmovies-online.net"></a>
          <br />
          <a href="https://www.embedgooglemap.net"></a>
        </div>
      </MapStyled>
    </div>
  );
}

export default App;
